import {useState, useEffect} from 'react';


function Form(){

    useEffect(() => {
        console.log("Use Effect Processed!");
    });

    const [email,setEmail]=useState("");

    return(

        <div>
            <br></br>

            <center>
                Email <br/>
                <input type = "text" placeholder="Enter Email" value={email} onChange={(e)=> setEmail(e.target.value)}></input>
                <button onClick={()=> setEmail("souravdutta@nsec.ac.in")}>Press</button>
            </center>
            

        </div>
    )
}

export default Form
